import React, { useEffect, useState } from "react";
import tasdiqlash from "../Assets/tasdiqlash.svg";
import bekorqilish from "../Assets/bekorqilish.svg";
import bloklash from "../Assets/bloklash.svg";
import logoutimg from "../Assets/loguot.svg"
import { useNavigate } from "react-router-dom";
// import swiper
import "swiper/css";

import "swiper/css/autoplay";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, Navigation } from "swiper/modules";



export default function Moder() {
  const [announcements, setAnnouncements] = useState([]);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate()
  const [pagination, setPagination] = useState([])

  useEffect(() => {
    const token = getCookie("token");

    const url = new URL(
      "https://api.frossh.uz/api/announcement/get-by-moderation"
    );
    const headers = {
      Authorization: `Bearer ${token}`,
      "Content-Type": "application/json",
      Accept: "application/json",
    };

    setLoading(true);

    fetch(url, {
      method: "GET",
      headers,
    })
      .then((response) => response.json())
      .then((data) => {
        setAnnouncements(data.result.data);
        setLoading(false);
        setPagination(data?.result?.links)
        console.log(data?.result?.links);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setLoading(false);
      });
  }, []);

  const getCookie = (name) => {
    const value = `; ${document.cookie}`;
    const parts = value.split(`; ${name}=`);
    if (parts.length === 2) return parts.pop().split(";").shift();
  };
  // reject function
  const reject = (id) => {
    const url = new URL(`https://api.frossh.uz/api/announcement/reject/${id}`);

    const token = getCookie("token");
    const headers = {
      Authorization: `Bearer ${token}`,
      "Content-Type": "application/json",
      Accept: "application/json",
    };

    setLoading(true);

    fetch(url, {
      method: "GET",
      headers,
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setLoading(false);
        fetchData();
      })
      .catch((error) => {
        console.error("Xato:", error);
        setLoading(false);
      });
  };
  // accept function
  const accept = (id) => {
    const url = new URL(`https://api.frossh.uz/api/announcement/accept/${id}`);

    const token = getCookie("token");
    const headers = {
      Authorization: `Bearer ${token}`,
      "Content-Type": "application/json",
      Accept: "application/json",
    };

    setLoading(true);

    fetch(url, {
      method: "GET",
      headers,
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setLoading(false);
        fetchData();
      })
      .catch((error) => {
        console.error("Xato:", error);
        setLoading(false);
      });
  };


  // block function
  const block = (id) => {

    const url = new URL(`https://api.frossh.uz/api/announcement/block/${id}`);

    const token = getCookie("token");
    const headers = {
      "Authorization": `Bearer ${token}`,
      "Content-Type": "application/json",
      "Accept": "application/json",
    };

    setLoading(true);

    fetch(url, {
      method: "GET",
      headers,
    })
      .then(response => response.json())
      .then(data => {
        console.log(data);
        setLoading(false);
        fetchData();
      })
      .catch(error => {
        console.error('Xato:', error);
        setLoading(false);
      });
  };



  const fetchData = (param) => {
    const token = getCookie("token");

    const url = param ? param : new URL(
      "https://api.frossh.uz/api/announcement/get-by-moderation"
    );
    const headers = {
      Authorization: `Bearer ${token}`,
      "Content-Type": "application/json",
      Accept: "application/json",
    };

    setLoading(true);

    fetch(url, {
      method: "GET",
      headers,
    })
      .then((response) => response.json())
      .then((data) => {
        setAnnouncements(data?.result?.data);

        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setLoading(false);
      });
  };

  // logout function
  const logoutfunction = () => {
    document.cookie = 'token=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;';
    localStorage.removeItem('tel')
    navigate('/');

    const token = getCookie("token");
    fetch("https://api.frossh.uz/api/auth/logout", {
      method: 'POST',
      headers: {
        'Authorization': `Bearer ${token}`,
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error('HTTP error, status = ' + response.status);
        }
        return response.json();
      })
      .then(data => {
        console.log(data);
      })
      .catch(error => {
        console.error('Fetch error:', error);
      });
  };

  return (
    <div className="moder">
      {loading && <div className="loader"></div>}
   <div className="container">
        {announcements?.map((item, index) => (
          <div className="card" key={index}>

            <Swiper
              slidesPerView={1}
              autoplay={{ delay: 3000 }}

              loop
              navigation={true}
              modules={[Autoplay, Navigation]}
            >
              {item?.images?.map((slide) => (
                <SwiperSlide className="slide-item" key={slide?.id}>
                  <img
                    src={`https://api.frossh.uz/${slide?.path}`}
                    alt="slide-item"
                  />
                </SwiperSlide>
              ))}

            </Swiper>
            <p>{item.price_uzs_formatted}UZS</p>
            <p>{item.slug}</p>
            <span>foydalanuvchi malumotlari:</span>
            <span>{item.user.phone_number}</span>
            <div className="controler">
              <div className="last">
                <span>{item.user.last_name}</span>
                <span>{item.address}</span>
              </div>
              <div className="control">
                <button onClick={() => accept(item.id)}>
                  <img src={tasdiqlash} alt="" />
                </button>
                <button onClick={() => reject(item.id)}>
                  <img src={bekorqilish} alt="" />
                </button>
                <button onClick={() => block(item.id)}  >
                  <img src={bloklash} alt="" />
                </button>
              </div>
            </div>
          </div>
        ))}
   </div>


      <div className="pagination-card">
        {
          pagination?.map((item) => (
            <button


              key={item?.label}
              dangerouslySetInnerHTML={{
                __html: item?.label
                  ?.replace(/\b(Previous|Next)\b/g, "")
                  ?.trim(),
              }}
              onClick={() => {

                if (item.label === "..." || item.active) {
                  return null

                }
                fetchData(item?.url)
              }}
              className={item?.active ? "active" : undefined}
              disabled={!item?.url || !announcements?.length}
            />
          ))



        }
      </div>




      <button onClick={() => logoutfunction()} id="logout" >
        <img src={logoutimg} alt="" />
      </button>
    </div>
  );
}
